import logo from './logo.svg';
import './App.css';
import Headerbanner from './components//header/header.js';
import Footer from './components/footer/footer.js';

function App() {
  return (
    <div className="App">
      <Headerbanner/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Footer/>
    </div>
  );
}

export default App;
